import logo from './logo.svg';
import './App.css';
import inicioI from "./assets/img/icons8-star-trek-espacio-profundo-nueve-96.png";
import sobreMei from "./assets/img/icons8-star-trek-espacio-profundo-nueve-96.png";
import proyectos from "./assets/img/icons8-star-trek-espacio-profundo-nueve-96.png";
import miAporte from "./assets/img/icons8-star-trek-espacio-profundo-nueve-96.png";
function App() {
  return (
    <div id='body' className="App">
        <nav>
          <div><a><img src={inicio}></img><h3>Inicio</h3></a></div>
          <div><a><img src="/assets/img/icons8-astronauta-60.png"></img><h3>Sobre mi</h3></a></div>
          <div><a><img src="/assets/img/icons8-cohete.png"></img><h3>Proyectos</h3></a></div>
          <div><a><img src="/assets/img/icons8-estrellas-96.png" ></img><h3>Mi aporte</h3></a></div>
        </nav>
    </div>
  );
}

export default App;
